/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "swift-3-extensions"
    }}>{`Swift 3 Extensions`}</h1>
    {
      /* TOC */
    }
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#swift-3-extensions"
        }}>{`Swift 3 Extensions`}</a><ul parentName="li">
          <li parentName="ul"><a parentName="li" {...{
              "href": "#extensions"
            }}>{`Extensions`}</a><ul parentName="li">
              <li parentName="ul"><a parentName="li" {...{
                  "href": "#-----computed-properties"
                }}>{`---- Computed Properties`}</a></li>
              <li parentName="ul"><a parentName="li" {...{
                  "href": "#-----mutating-instance-methods"
                }}>{`---- Mutating Instance Methods`}</a></li>
              <li parentName="ul"><a parentName="li" {...{
                  "href": "#-----subscripts"
                }}>{`---- Subscripts`}</a></li>
              <li parentName="ul"><a parentName="li" {...{
                  "href": "#-----nested-types"
                }}>{`---- Nested Types`}</a></li>
            </ul></li>
        </ul></li>
    </ul>
    {
      /* /TOC */
    }
    <hr></hr>
    <h2 {...{
      "id": "extensions"
    }}>{`Extensions`}</h2>
    <p>{`Extensions add new functionality to an existing class, structure, enumeration, or protocol type.`}</p>
    <p>{`This includes the ability to extend types for which you do not have access to the original source code (known as retroactive modeling). Extensions are similar to categories in Objective-C. (Unlike Objective-C categories, Swift extensions do not have names.)`}</p>
    <p>{`Extensions in Swift can:`}</p>
    <ul>
      <li parentName="ul">{`Add computed instance properties and computed type properties`}</li>
      <li parentName="ul">{`Define instance methods and type methods`}</li>
      <li parentName="ul">{`Provide new initializers`}</li>
      <li parentName="ul">{`Define subscripts`}</li>
      <li parentName="ul">{`Define and use new nested types`}</li>
      <li parentName="ul">{`Make an existing type conform to a protocol`}</li>
    </ul>
    <pre><code parentName="pre" {...{}}>{`extension SomeType: SomeProtocol, AnotherProtocol {
    // implementation of protocol requirements goes here
}
`}</code></pre>
    <div id="computed"></div>
    <h3 {...{
      "id": "-----computed-properties"
    }}>{`---- Computed Properties`}</h3>
    <pre><code parentName="pre" {...{}}>{`struct Size {
    var width = 0.0, height = 0.0
}
struct Point {
    var x = 0.0, y = 0.0
}
struct Rect {
    var origin = Point()
    var size = Size()
}

let defaultRect = Rect()
let memberwiseRect = Rect(origin: Point(x: 2.0, y: 2.0), size: Size(width: 5.0, height: 5.0))

extension Rect {
    init(center: Point, size: Size) {
        let originX = center.x - (size.width / 2)
        let originY = center.y - (size.height / 2)
        self.init(origin: Point(x: originX, y: originY), size: size)
    }
}

let centerRect = Rect(center: Point(x: 4.0, y: 4.0),
                      size: Size(width: 3.0, height: 3.0))
// centerRect's origin is (2.5, 2.5) and its size is (3.0, 3.0)
`}</code></pre>
    <p>{`Extensions can add new instance methods and type methods to existing types. The following example adds a new instance method called repetitions to the Int type:`}</p>
    <pre><code parentName="pre" {...{}}>{`extension Int {
    func repetitions(task: () -> Void) {
        for _ in 0..<self {
            task()
        }
    }
}

3.repetitions {
    print("Hello!")
}
// Hello!
// Hello!
// Hello!
`}</code></pre>
    <div id="mutating"></div>
    <h3 {...{
      "id": "-----mutating-instance-methods"
    }}>{`---- Mutating Instance Methods`}</h3>
    <pre><code parentName="pre" {...{}}>{`extension Int {
    mutating func square() {
        self = self * self
    }
}
var someInt = 3
someInt.square()
// someInt is now 9
`}</code></pre>
    <h3 {...{
      "id": "-----subscripts"
    }}>{`---- Subscripts`}</h3>
    <p>{`Extensions can add new subscripts to an existing type. This example adds an integer subscript to Swiftâ€™s built-in Int type. This subscript `}{`[n]`}{` returns the decimal digit n places in from the right of the number:`}</p>
    <pre><code parentName="pre" {...{}}>{`123456789[0] returns 9
123456789[1] returns 8
`}</code></pre>
    <pre><code parentName="pre" {...{}}>{`extension Int {
    subscript(digitIndex: Int) -> Int {
        var decimalBase = 1
        for _ in 0..<digitIndex {
            decimalBase *= 10
        }
        return (self / decimalBase) % 10
    }
}
746381295[0]
// returns 5
746381295[1]
// returns 9
746381295[2]
// returns 2
746381295[8]
// returns 7

746381295[9]
// returns 0, as if you had requested:
0746381295[9]
`}</code></pre>
    <h3 {...{
      "id": "-----nested-types"
    }}>{`---- Nested Types`}</h3>
    <p>{`Extensions can add new nested types to existing classes, structures, and enumerations:`}</p>
    <pre><code parentName="pre" {...{}}>{`extension Int {
    enum Kind {
        case negative, zero, positive
    }
    var kind: Kind {
        switch self {
        case 0:
            return .zero
        case let x where x > 0:
            return .positive
        default:
            return .negative
        }
    }
}

// The nested enumeration can now be used with any Int value:

func printIntegerKinds(_ numbers: [Int]) {
    for number in numbers {
        switch number.kind {
        case .negative:
            print("- ", terminator: "")
        case .zero:
            print("0 ", terminator: "")
        case .positive:
            print("+ ", terminator: "")
        }
    }
    print("")
}
printIntegerKinds([3, 19, -27, 0, -6, 0, 7])
// Prints "+ + - 0 - 0 + "
`}</code></pre>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
